import React from "react";
//import SearchField from "./searchField";
import Background from "./img/background.jpg";
import NavBar from "./navbar";

class Edit extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            date: '',
        };
    }

    componentDidMount = () => {
        console.log(this.props.location.state.id)
    };

    handleSubmit(event) {
        this.props.history.push('/overview');
    }

    handleClick = () => {
        this.props.history.push('/');
    };

    getFromdate = () => {
        return JSON.parse(localStorage.getItem("lines")).PtSituationElement[this.props.location.state.id].description["@value"]
    };

    render() {
        return (
            <div>
                <img id="background" src={ Background } alt="" />
                <div className="navBar">
                </div>
                <NavBar />
                <div className="register_box" id="overview" >
                    <h2 className="text-center text-white">Endre avvik</h2>
                    <p className="text-center text-white">Melding</p>
                    <input type="String" name="oppsummering" className="form-control" placeholder={this.getFromdate} required/>
                    <input type="String" name="beskrivelse" className="form-control" placeholder="Beskrivelse"/>
                    <br></br>
                    <p className="text-center text-white">Gyldighetsdato</p>
                    <div className="form-group d-flex">
                        <input type="datetime-local" name="from" id="from" className="form-control" readonly="readonly" />
                        <input onChange={this.handleChangeDate} type="datetime-local" name="to" id="to" className="form-control" required/>
                    </div>
                    <div className="submit justify-content-center">
                        <button type="submit" className="btn btn-primary btn-lg btn-block">Endre</button>
                        <button onClick={this.handleClick} type="submit" className="btn btn-warning btn-lg btn-block">Tilbake</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Edit;
